script: |
  super -f text -I q289.spq > q289.out

inputs:
  - name: q289.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE e+d BETWEEN a+b-10 AND c+130
      OR d>e
      OR a>b
      ORDER BY 1;
  - name: t1

